import { createIcon } from "../icon/createIcon";

export const PrintSolidIcon = createIcon(
  <svg viewBox="0 0 12 12" data-testid="PrintSolidIcon">
    <path d="M1 8a1 1 0 0 1-1-1V3a1 1 0 0 1 1-1h1V0h8v2h1a1 1 0 0 1 1 1v4a1 1 0 0 1-1 1h-1l1 4H1l1-4H1zm7 1H4v1h4V9zm1-3H3v1h6V6zm0-5H3v1h6V1z" />
  </svg>,
  "PrintSolid",
  "print solid"
);
